(7, 7, '_form', '<label> Tên của bạn\n    [text* your-name autocomplete:name] </label>\n\n<label> Email của bạn\n    [email* your-email autocomplete:email] </label>\n\n<label> Tiêu đề:\n    [text* your-subject] </label>\n\n<label> Tin nhắn của bạn (không bắt buộc)\n    [textarea your-message] </label>\n\n[submit \"Gửi\"]'),
(8, 7, '_mail', 'a:8:{s:7:\"subject\";s:30:\"[_site_title] \"[your-subject]\"\";s:6:\"sender\";s:43:\"[_site_title] <noreplythismail79@gmail.com>\";s:4:\"body\";s:259:\"Gửi đến từ: [your-name] [your-email]\nTiêu đề: [your-subject]\n\nNội dung thông điệp:\n[your-message]\n\n-- \nĐây là thông báo cho biết một biểu mẫu liên hệ đã được gửi trên trang web của bạn ([_site_title] [_site_url]).\";s:9:\"recipient\";s:19:\"[_site_admin_email]\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";i:0;s:13:\"exclude_blank\";i:0;}'),
(9, 7, '_mail_2', 'a:9:{s:6:\"active\";b:0;s:7:\"subject\";s:30:\"[_site_title] \"[your-subject]\"\";s:6:\"sender\";s:43:\"[_site_title] <noreplythismail79@gmail.com>\";s:4:\"body\";s:315:\"Nội dung thông điệp:\n[your-message]\n\n-- \nEmail này là biên nhận cho việc bạn đã gửi biểu mẫu liên hệ trên trang web của chúng tôi ([_site_title] [_site_url]) trong đó địa chỉ email của bạn đã được sử dụng. Nếu không phải bạn, vui lòng bỏ qua email này.\";s:9:\"recipient\";s:12:\"[your-email]\";s:18:\"additional_headers\";s:29:\"Reply-To: [_site_admin_email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";i:0;s:13:\"exclude_blank\";i:0;}'),
